import React from 'react';
import './App.scss';
import {Accueil} from "./features/documents/Accueil";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import {PokeListe} from "./features/documents/PokeListe";

function App() {
  return (
  <Router>
    <div>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <ul class="navbar-nav mr-auto">
          <li class="nav-item active">
            <Link class="nav-link" to="/">Accueil</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/about">Pok√© liste</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/users">Mes favoris</Link>
          </li>
        </ul>
      </nav>

      {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
      <Switch>
        <Route exact path="/">
          <Accueil />
        </Route>
        <Route path="/poke-liste">
          <PokeListe />
        </Route>
        <Route path="/mes-favoris">

        </Route>
      </Switch>
    </div>
  </Router>
  );
}

export default App;
